DATA = [
    '',
    '',
    '',
    '',
    ''
]

assert len(DATA) == 5

TEST_DATA = [
    'ULL',
    'RRDDD',
    'LURDL',
    'UUUUD'
]

GRID = [
    ['1', '2', '3'],
    ['4', '5', '6'],
    ['7', '8', '9']
]


def _solve_one_line(line, loc):
    for step in line:
        if step == 'U' and loc[0] > 0:
            loc[0] -= 1
        if step == 'D' and loc[0] < 2:
            loc[0] += 1
        if step == 'L' and loc[1] > 0:
            loc[1] -= 1
        if step == 'R' and loc[1] < 2:
            loc[1] += 1
    button = GRID[loc[0]][loc[1]]
    return button


def solve(data):
    loc = [1, 1]
    code = ''
    for line in data:
        code += _solve_one_line(line, loc)
    return int(code)


assert 1985 == solve(TEST_DATA)
print(solve(DATA))
